// Helpers: trae nodos previos
const currency = $('informacion cliente').first().json.Moneda === "COP" ? Number($input.first().json.result) : 1;
const tierNames = {
  "1":"Precio Recomendado de Venta Cliente Final\n(USD)",
  "2":"Precio Unitario Revendedor / Aliado (USD)",
  "3":"Precio Unitario MSP"
};
const form = $('set db prices').all().map(item => item.json);
const dirCantidades = $('seleccion de cantidades').first().json;
const products = $('seleccion productos').first().json["Productos a cotizar"];

const rows = form.filter((item => products.find(i => item["Nombre de Producto"] === i)));

const cotizar = [];
const tier = tierNames[$('Basic LLM Chain').first().json.text];
let total = 0;
for(const item of rows){
  const unitValue =item[tier] * currency
  const value = unitValue * dirCantidades[item["Nombre de Producto"]];
  total += value;
  cotizar.push({
    name: item["Nombre de Producto"], 
    cuantity: dirCantidades[item["Nombre de Producto"]],
    category: item["Licenciamiento"],
    description: item["Descripción Larga de servicio"],
    unitValue,
    subtotal: value ,
    "currency": $('informacion cliente').first().json.Moneda,
  });
}


return [{cotizar,total}];

